import React from "react";

class Data extends React.Component{
    state={
       name:"Aish",
       city:"Hosur"
    } 
       render(){
        return(
            <div>
                <h1>Without Construtor</h1>
                {this.state.name} {this.state.city}
                <h3>00:00:00</h3>
                <button>Start</button>
                <button>Stop</button>
                <button>Reset</button>
            </div>
        )
    }
}
export default Data;
